sys_variable_value.value:
(function execute(inputs, outputs) {
  var bodyArray = [];
  var csaRef = [];

  csaRef.push({name: "CSAVendor", value: "V202"});
  csaRef.push({name: "CSAPrefix", value: "P01"});
  csaRef.push({name: "CSASType", value: "T001"});
  csaRef.push({name: "CSACircuit", value: "C00201"});
  csaRef.push({name: "CSAUiden", value: "U01"});
  bodyArray.push({name: "PostAwardID", value: inputs.post_award_id});
  bodyArray.push({name: "Description", value: "JWCC"});
  bodyArray.push({name: "CreateAllLevels", value: true});
  bodyArray.push({name: "CSARef", value: csaRef});
  outputs.body = [];
  outputs.body.push(bodyArray);

})(inputs, outputs);

